Comportement dsorganis, exemple : discours incohrent/hors sujet,
monoloques, rires sans justification (rires immotivs), apparence trange,
signes de laisser aller ou d'apparence nglige ;

Crises sous forme de perte d'une fonction de la vie de relation (conscience,
vue, audition, motricit, language, ...), semblable  une crise d'pilepsie,
sans explication anatomique - ni physio-pathologique ;
